import React from "react";
import { Link } from "react-router-dom";
import "./Login.css";

function Login() {
  return ( 
      <div className='login'>
        <Link to='/'>
            <img className="login_logo" 
                 src="/Amazon-Logo.png"/>        </Link>
      </div>
  )
}

export default Login;
